import React, { useState } from 'react'

const ChangeMessage = () => {

    const [change, setChange] = useState("Hello World1")

    const clickHandel = () => {
        setChange("Hello India!")
    }

    return(
        <>
            <h1>{change}</h1>
            <button onClick={clickHandel}></button>
        </>
    )
}

export default ChangeMessage
